from pyspark import keyword_only
from pyspark.ml import Transformer
from pyspark.ml.param.shared import HasInputCol, HasOutputCol, Param, Params, TypeConverters
from pyspark.ml.util import DefaultParamsReadable, DefaultParamsWritable
from pyspark.sql import DataFrame
import pyspark.sql.functions as F

class MonthSineTransformer(Transformer):  
    def __init__(self, input_col= "month", output_col = "month_sin"):    
        super(MonthSineTransformer, self).__init__()
        self.input_col = input_col
        self.output_col = output_col

    def _transform(self, df):
        return df.withColumn(self.output_col, F.sin((col(self.input_col)*pi)/6))

class MonthCosTransformer(Transformer):  
  def __init__(self, input_col = "month", output_col = "month_cos"):    
    super(MonthCosTransformer, self).__init__()
    self.input_col = input_col
    self.output_col = output_col

  def _transform(self, df):
    return df.withColumn(self.output_col, F.cos((col(self.input_col)*pi)/6))
